export const homeObjOne = {
    id: 'about',
    lightBg: false,
    lightText: true,
    lightTextDesc: true,
    topLine: 'Jonathan Tan',
    headline: 'E-Scholars Programme (NUS)',
    description: 'Undergraduate in Mechanical Engineering (Robotics), with an avid interest for machine learning and automation.',
    buttonLabel: 'Contact Me',
    imgStart: true,
    img: '/images/1.svg',
    alt: 'projects',
    dark: true,
    primary: true,
    darkText: false,
};

export const homeObjTwo = {
